import React, { useContext } from 'react';
import styles from '../../styles/components/admin_navbar.module.scss';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import NewProject from '../modals/NewProjects';

import { AuthActions } from '../../context/contexts/auth.context';

import useToggle from '../../hooks/useToggle';

import NavbarBtn from '../layout/NavbarBtn';

const AdminNavbar = () => {
	const { logout } = useContext(AuthActions);
	const [ newProject, toggleNewProject ] = useToggle(false);

	return (
		<nav className={styles.navbar}>
			<div className={styles.navbar__controls}>
				<NavbarBtn>
					<FontAwesomeIcon icon="home" />
				</NavbarBtn>
				<NavbarBtn onClick={toggleNewProject}>
					<FontAwesomeIcon icon="newspaper" />
				</NavbarBtn>
				<NavbarBtn>
					<FontAwesomeIcon icon="cog" />
				</NavbarBtn>
				<NavbarBtn>
					<FontAwesomeIcon icon="sign-out-alt" />
				</NavbarBtn>
				<NewProject show={newProject} toggle={toggleNewProject} />
			</div>
			<div className={styles.navbar__pages}>
				<h5 className={styles.navbar__pages__header}>Pages</h5>
				<ul className={styles.navbar__pages__list}>
					<li className={styles.navbar__pages__item}>
						<a className={styles.navbar__pages__link} href="/home"><FontAwesomeIcon className={styles.navbar__pages__icon} icon="home" />Home</a>
					</li>
					<li className={styles.navbar__pages__item}>#
						<a className={styles.navbar__pages__link} href="#"><FontAwesomeIcon className={styles.navbar__pages__icon} icon="at" />Contact</a>
					</li>
					<li className={styles.navbar__pages__item}>
						<a className={styles.navbar__pages__link} href="#"><FontAwesomeIcon className={styles.navbar__pages__icon} icon="smile" />About</a>
					</li>
				</ul>
			</div>
		</nav>
	);
};

export default AdminNavbar;
